import React, { Component } from 'react'
import jsTPS_Unit_Tests from '../test_beds/jsTPS_Unit_Tests'

class TestBedScreen extends Component {

    runTests() {
        let tests = new jsTPS_Unit_Tests();
        document.write('Running tests on jsTPS...<br>');
        document.write('Test (1/6): Testing add function...<br>');
        tests.testAdd();
        document.write('Test passed.<br><br>');

        document.write('Test (2/6): Testing andMask function...<br>');
        tests.testAndMask();
        document.write('Test passed.<br><br>');

        document.write('Test (3/6): Testing orMask function...<br>');
        tests.testOrMask();
        document.write('Test passed.<br><br>');

        document.write('Test (4/6): Testing undoTransaction function...<br>');
        tests.testUndo();
        document.write('Test passed.<br><br>');

        document.write('Test (5/6): Testing redoTransaction function...<br>');
        tests.testRedo();
        document.write('Test passed.<br><br>');

        document.write('Test (6/6): Testing clearAllTransactions function...<br>');
        tests.testClear();
        document.write('Test passed.<br><br>');
        document.write('All tests on jsTPS passed.<br>');
    }

    runTests() {
        let tests = new jsTPS_Unit_Tests();
        const testScript = (
            <ul>
                <li>'Running tests on jsTPS...'</li>
                <li>Test (1/6): Testing add function...'</li>
                <script>tests.testAdd();</script>
                <li>'Test passed.'</li>
                <li>'Running tests on jsTPS...'</li>
                <li>Test (2/6): Testing andMask function...'</li>
                <script>tests.testAndMask();</script>
                <li>'Test passed.'</li>
                <li>'Running tests on jsTPS...'</li>
                <li>Test (3/6): Testing orMask function...'</li>
                <script>tests.testOrMask();</script>
                <li>'Test passed.'</li>
                <li>'Running tests on jsTPS...'</li>
                <li>Test (4/6): Testing undoTransaction function...'</li>
                <script>tests.testUndo();</script>
                <li>'Test passed.'</li>
                <li>'Running tests on jsTPS...'</li>
                <li>Test (5/6): Testing redoTransaction function...'</li>
                <script>tests.testRedo();</script>
                <li>'Test passed.'</li>
                <li>'Running tests on jsTPS...'</li>
                <li>Test (6/6): Testing clearAllTransactions function...'</li>
                <script>tests.testClear();</script>
                <li>'Test passed.'</li>
            </ul>
        );
        return testScript;
    }

    render() {
        return (
            <div>
                <p>
                    {this.runTests()};
                </p>
                <div>
                    <p>Click 'Back' to exit test bed.</p>
                    <button onClick={this.props.goTestHome}>Back</button>
                </div>
            </div>
        )
    }
}

export default TestBedScreen;
